function CalculatePO(n,t){return((new Date).getTime()-n.getTime())/t}function CalculatePOS(n){return CalculatePO(n,1e3)}function CalculateLength(n,t){return Math.sqrt(Math.pow(n.X-t.X,2)+Math.pow(n.Y-t.Y,2))}function CalculateDistance(n,t){return new Vector2(Math.abs(t.X-n.X),Math.abs(t.Y-n.Y))}function CalculateAngle(n,t){var r=Vector2.SubtractV(n,t),i=Math.atan2(r.Y,r.X)*-180/Math.PI;return i<0&&(i+=360),i}function StandardDeviation(n){for(var r=Average(n),i=0,t=0;t<n.length;t++)i+=Math.pow(n[t]-r,2);return Math.sqrt(i/(n.length-1))}function Average(n){for(var i=0,t=0;t<n.length;t++)i+=n[t];return i/n.length}var delay=function(){var n=0;return function(t,i){clearTimeout(n),n=setTimeout(t,i)}}();jQuery.fn.flash=function(n,t){this.stop(!0);var i=this.css("backgroundColor");this.animate({backgroundColor:"rgb("+n+")"},t/2).animate({backgroundColor:i},t/2)}